import React from 'react';

const List = ({person}) => {
  return (
    <>
      {people.map((person)=>{
    const {name, age, image, id} = person;
    return (
      <article key={id} className='person'>
        <img src={image} alt=""/>
      </article>
    )
    })
  }
    </>
  );
};

export default List;
